marked as duplicate by Bergi  javascript May 1 '15 at 15:00
You can use a custom sort function:
var myList = ['a', 'B', 'c', 'A'];
myList.sort(function(a, b) {
    if (a.toLowerCase() < b.toLowerCase()) return -1;
    if (a.toLowerCase() > b.toLowerCase()) return 1;
    if (a < b) return -1;
    if (a > b) return 1;
console.log(myList);
// Outputs ["A", "a", "B", "c"]
This function will only return 0 if the two elements being compared are exactly the same (i.e. the two elements are the same index in the array). Otherwise, it will sort them based on case-insensitive comparison, and if they're the same it will sort them based on case-sensitive comparison.
