    client_id: '...',
    client_secret: '...',
    tenant: '...',
    subscription_id: '...',
    management_host: 'management.core.windows.net',
    base_uri: 'https://management.core.windows.net'
});

var azure = new Azure({
    client_id: '...',
    client_secret: '...',
    tenant: '...',
    subscription_id: '...',
    management_host: 'management.core.windows.net',
    base_uri: 'https://management.core.windows.net'
});

airflow.login(function (err, token) {
    if (err) return console.error(err);
